pragma solidity >=0.4.0 <0.6.0;

import './CredibleCore.sol';

contract Credible is CredibleCore {
    constructor (string memory name, string memory symbol) public Users() ERC721Full(name, symbol)  {
        // solhint-disable-previous-line no-empty-blocks        
    }

    function mint(string memory uri, bytes32 asset) public onlyUser returns (uint256) {
      return _mintAsset(uri, asset);
    }

    function update(string memory uri, bytes32 asset, uint256 tokenId) public onlyUser {
      _update(uri, asset, tokenId);
    }

    function rescue(address to, uint256 tokenId) public onlyOwner {
        _rescue(to, tokenId);
    }

    function burn(uint256 tokenId) public onlyOwner{
        _burn(tokenId);
    }

    function reclaimEther(address payable receiver) external onlyOwner {
      _reclaimEther(receiver);
    }
}
